import ReactDOM from "react-dom/client";
import "./index.css";
const App = <div className="logs">{list}</div>;
const data = [
  {
    id: 11,
    month: "四月",
    day: 19,
    desc: "感觉埃里克森国家的卡卡黄金卡了估计",
    time: 111,
  },
  {
    id: 432,
    month: "八月",
    day: 29,
    desc: "结果肯定是拉开进攻都是辣的机构行家但是",
    time: 43215,
  },
  {
    id: 53,
    month: "十二月",
    day: 12,
    desc: "附近的萨克两个贷记卡独立国家",
    time: 421,
  },
];
const list = [];
list = data.map((item) => {
  return (
    <div className="item">
      <div className="date">
        <div className="month">{item.month}</div>
        <div className="day">{item.day}</div>
      </div>
      <div className="content">
        <h2 className="desc">{item.desc}</h2>
        <div className="time">{item.time}分钟</div>
      </div>
    </div>
  );
});

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(App);
